	/// <summary>
	/// Returns text for the next/previous month button tooltip depending upon direction.
	/// </summary>
	static string GetNextMonthTooltip(int offset)
	{
		DateTime nextMonth = GetVisibleDate().AddMonths(offset);
		string format = "MMMM";
		return nextMonth.ToString(format);
	}

	/// <summary>
	/// Internal function to convert FirstDayOfTheWeek into valid DayOfTheWeek.
	/// </summary>
	static public DayOfWeek GetWeekStart()
	{
		return DateTimeFormatInfo.CurrentInfo.FirstDayOfWeek;
	}

	/// <summary>
	/// Get a valid visible date, based on VisibleDate and TodayDate.
	/// </summary>
	static DateTime GetVisibleDate()
	{
		return GetTodayDate();
	}

	/// <summary>
	/// Get a valid to today date, based on TodayDay settings.
	/// </summary>
	static DateTime GetTodayDate()
	{
		return PXTimeZoneInfo.Now;
	}

	/// <summary>
	/// Calculates the first date to start render depending on visible date,
	/// and preset week start day.
	static DateTime GetStartingDate()
	{
		DateTime visibleDate = GetVisibleDate();
		DateTime startingDate = new DateTime(visibleDate.Year, visibleDate.Month, 1);
		int offset = (GetWeekStart() - (startingDate.DayOfWeek + 7)) % 7;
		return startingDate.AddDays((double)offset);
	}

	static string GetDateInvariant(DateTime d)
	{
		return d.ToString("d", CultureInfo.InvariantCulture);
	}

        
